import React, { Component } from 'react'
import PropTypes from 'prop-types'

export class Form extends Component {
    
    constructor(props){
        super(props)

        this.state={
            studentName:''
        }

    }

    handleStudentNameChange=(event)=>{
        this.setState({
            studentName:event.target.value
        })     
    }

    handleMobileNumberChange=(event)=>{
        this.setState({
            studentName:event.target.value
        })     
    }

    andleMobileNumberChange=(event)=>{
        this.setState({
            studentName:event.target.value
        })     
    }
   

    render() {
        return (
            <form>
                <div>
                    <label>Student Name: </label>
                    <input type="text" placeholder="Enter Name" value={this.state.studentName} onChange={this.handleStudentNameChange}/>
                </div>
                <div>
                    <label>Mobile Number: </label>
                    <input type="number" placeholder="Enter Mobile no." value={this.state.mobileNumber} onChange={this.handleMobileNumberChange}/>
                </div>
                <div>
                    <label>Email Address: </label>
                    <input type="email" placeholder="Enter email address" value={this.state.email} onChange={this.handleEmailChange}/>
                </div>
            </form>
        )
    }
}

export default Form
